  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"March 5, 2007    Daniel Buckley  Federal
    Election Commission  Washington DC 20463    Re:\t12 Day Pre-Runoff Report (October
    19, 2006 to November 22, 2006)    Pursuant to your letter dated, December February
    2, 2007, regarding the 12 Day Pre-General Report, we are responding to your questions
    as follows:  Beginning cash balance is correctly reported on this report.  The
    balance reflects changes due to amendments being filed for the May Monthly 2006
    report through the current report.  This report also reflects changes in each
    line of activity and the Calendar Year to Date totals as a result of these amended
    reports.  Schedule A line 11c, includes transfers received from the Republican
    Party of Dallas on October 24, 2006 as a check and November 1 2006 as a wire transfer
    and have been duly accounted for in this report.  Schedule B, Line 28a reflects
    the correction of our reporting of a check written to refund a contribution originally
    received by our committee.  Schedule B Line 21b memo entries in the amount of
    $305 have been coded to identify and correspond to the itemized expenditure.  Schedule
    B Line 29 reports expenditures to the Republican Party of Texas in the amount
    of $1,363.26, which we determined to be the fair market value for names provided
    (to two State campaigns: one for Sid Miller District 59 and Bill Callegari District
    132) from the Partys in-house data files.  As a result of this fair market valuation,
    there are no specific operating expenditures to which these in-kinds are tied.
    \ Schedule B reporting of Fundraising Consultants Retainer does not reflect a
    payment made on behalf of specifically identified federal candidates.  This expenditure
    is for the direct fundraising of the Party and has been changed to Party Fundraising
    Consultant Retainer.  Schedule B, Line 30b discloses reimbursements which do not
    exceed the $200 vendor aggregation; therefore, itemization of each vendor is not
    necessary.  Schedule H2 ration for Houston Event Fed Levin Split has been changed
    to reflect the on going reporting of the event.  Schedule H4 and H6 - allocated
    activity and event year to date totals were affected when coding was changed to
    identify generic voter activity.  The coding was done improperly and has been
    changed to make the year to date totals correct.  Schedule H5 disclosure of the
    transfer of allocated funds has been changed to properly reflect the Party Non
    Federal account.  Respectfully submitted, Wayne Tucker, Treasurer  \""
